import React from 'react'
import './home.css'
const { redibase } = require('./connect')
const username = redibase.get("username")
const message = `Welcome, ${username}`

class Users extends React.Component {
  render() {
    return <div>
      <h1>{message}</h1>

      <img src="https://cdn2.iconfinder.com/data/icons/font-awesome/1792/terminal-512.png" alt="Commands" height="50" />
    </div>
  }
}
export default Users
